package com.cc._02_HashSet;

import java.util.HashSet;

public class appendElement {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		HashSet<String> set= new HashSet<>();
        System.out.println(set);
		set.add("Red");
		System.out.println(set);
		set.add("Green");
		System.out.println(set);
		set.add("Blue");
		System.out.println(set);
		set.add("Black");
		System.out.println(set);
		set.add("Orange");
		System.out.println(set);
		set.add("Yellow");
		System.out.println(set);

	}

}
